import React from "react";
import styles from "./CustomInput.module.scss";
const CustomInput = ({ className, ...props }) => {
  return (
    <input
      className={`${style.input}` + ` ${className ? className : ""}`}
      {...props}
    />
  );
};

export default CustomInput;
